import React from 'react';
import './App.css';
import Header from './../Header/Header.jsx';
class App extends React.Component{
    state={
        headerText : 'Name-It!',
    };
    render()
    {
        return(
            <div>
                 <Header headTitle={this.state.headerText}/>
                 <Search/>
            </div>
        );
    }
}

export default App;
